public class Foo
{
    private String name;
    
    private String id;

    /**
     * @param name
     * @param id
     */
    public Foo(String name, String id)
    {
        super();
        this.name = name;
        this.id = id;
    }

    public String getName()
    {
        return name;
    }

    public void setName(String name)
    {
        this.name = name;
    }

    public String getId()
    {
        return id;
    }

    public void setId(String id)
    {
        this.id = id;
    }
    
    
}
